INSERT INTO `endings` (`id`, `survey_id`, `title`, `text`, `voice_file`) VALUES
(10, 1, '終了', '質問は以上となります。\r\nアンケートにご協力を頂きまして、誠にありがとうございました。どうぞお電話をお切りください。', 'e10_65e02cb12b3de.wav'),
(11, 1, '日程調整', '質問は以上となります。\r\nそれでは、後ほどオペレーターから日程調整のお電話が入りますので、ご対応をよろしくお願いします。\r\n最後までお付き合いいただき、誠にありがとうございました。\r\nどうぞお電話をお切りください。', 'e11_65e02cbf80820.wav');
INSERT INTO `faqs` (`id`, `survey_id`, `title`, `text`, `order_num`, `voice_file`) VALUES
(2, 1, '光熱費', '今回のおすすめプランの条件に合った家庭かどうかの光熱費をお尋ねします\r\n電気料金が毎月１万円以上お使いの方は１を・・・・\r\n１万円以下の方は２を・・・・\r\nもう一度お聞きになりたい方は０を押してください。', 1, 'f2_65e022ea784c0.wav'),
(5, 1, 'ご年齢', 'ご年齢についてお尋ねします。\r\n７６歳以上の方は１を・・・・\r\n７０歳から７５歳の方は２を・・・・\r\n３０歳から６９歳の方は３を・・・・\r\n２９歳以下の方は４を・・・・\r\nもう一度お聞きになりたい方は０を押してください。', 2, 'f5_65e026200c2a5.wav'),
(6, 1, 'お使いの給湯器', '電力プランを把握のために、お使いの給湯器をお尋ねします\r\nガス給湯器、または、灯油ボイラーをお使いの方は１を・・・・\r\nエコキュート、または、電気温水器をお使いの方はは２を・・・・\r\nそのほかの給湯器をお使いの方は３を・・・・\r\nもう一度お聞きになりたい方は０を押してください。', 3, 'f6_65e0296e5184c.wav'),
(7, 1, '太陽光パネルと蓄電池', '次に、太陽光パネルと蓄電池の導入状況についてお尋ねします\r\n太陽光パネルと蓄電池の両方を導入されている方は１を・・・・\r\n太陽光パネルのみを導入されている方は２を・・・・\r\n蓄電池のみ導入されている方は３を・・・・\r\nどちらも導入されていない方は４を・・・・\r\nもう一度お聞きになりたい方は０を押してください。', 4, 'f7_65e0298ebcf0c.wav'),
(8, 1, 'ご主人、奥様', '今、お電話口に出て頂いている方が\r\nご主人様でしたら１を・・・・\r\n奥様でしたら２を・・・・\r\nその他のご家族の方でしたら３を・・・・\r\nもう一度お聞きになりたい方は０を押してください。', 5, 'f8_65e029b0c5e72.wav'),
(9, 1, '無料シミュレーション', '以上の結果を踏まえて、現状のご使用状況であれば十分に電気代の削減が可能なご家庭となっております。\r\nつきましては、現状よりどのくらい電気料金が安くなるか、地域の専属アドバイザーが無料シミュレーションを\r\nご自宅にて実施いたしております。\r\n無料シミュレーションをご希望の方は１を・・・・\r\nそれ以外の方は２を・・・・\r\nもう一度お聞きになりたい方は０を押してください。', 6, 'f9_65e029d031aa1.wav'),
(10, 1, 'お住まい', 'それでは、現在のお住まいについてお尋ねします。\r\n一戸建て持ち家の方は１を・・・・\r\nアパート・マンション、賃貸住宅の方は２を・・・・\r\nもう一度お聞きになりたい方は０を押してください。', 0, 'f10_65e05158d7471.wav'),
(11, 2, 'デフォルトの質問', 'これはデフォルトの質問です、もう一度お聞きになりたい方は０を押してください。', 0, 'f11_65e8228b48926.wav'),
(12, 3, 'デフォルトの質問', 'これはデフォルトの質問です、もう一度お聞きになりたい方は０を押してください。', 0, 'f12_65e822c525049.wav');
